import React, { useState, useEffect } from 'react';
import { supabase } from '../../supabaseClient';
import {
  Chart as ChartJS,
  CategoryScale,
  LinearScale,
  PointElement,
  LineElement,
  Title,
  Tooltip,
  Legend,
  TimeScale
} from 'chart.js';
import 'chartjs-adapter-date-fns';
import AnxietyRiskChart from '../../components/charts/AnxietyRiskChart';
import { PM25Chart, CityComparisonChart } from '../../components/charts';

// Register Chart.js components
ChartJS.register(
  CategoryScale,
  LinearScale,
  PointElement,
  LineElement,
  Title,
  Tooltip,
  Legend,
  TimeScale
);

const Dashboard = ({ city }) => {
  const [data, setData] = useState({
    pm25Data: [],
    cityData: []
  });

  useEffect(() => {
    fetchData();
  }, [city]);

  const fetchData = async () => {
    try {
      // Fetch PM2.5 data for selected city
      const { data: pm25Data, error: pm25Error } = await supabase
        .from('weather_data')
        .select('created_at, pm25')
        .eq('city', city)
        .order('created_at', { ascending: true });

      if (pm25Error) throw pm25Error;

      // Fetch comparison data for all cities
      const { data: cityData, error: cityError } = await supabase
        .from('weather_data')
        .select('city, pm25')
        .order('created_at', { ascending: false })
        .limit(3);

      if (cityError) throw cityError;

      setData({
        pm25Data,
        cityData
      });

    } catch (error) {
      console.error('Error fetching data:', error);
    }
  };

  return (
    <div className="dashboard">
      <div className="dashboard-content">
        <h1>Air Quality Dashboard - {city}</h1>

        <div className="content-wrapper">
          <div className="chart-side">
            <div className="chart-container">
              <div className="chart">
                <h3>PM2.5 Levels Over Time</h3>
                {data.pm25Data.length > 0 ? (
                  <PM25Chart data={data.pm25Data} />
                ) : (
                  <p>Loading PM2.5 data...</p>
                )}
              </div>
              <div className="chart">
                <h3>City Comparison</h3>
                {data.cityData.length > 0 ? (
                  <CityComparisonChart data={data.cityData} />
                ) : (
                  <p>Loading city comparison data...</p>
                )}
              </div>
            </div>
          </div>

          <div className="data-side">
            <div className="key-data-points">
              <div className="key-data-title">Key Data Points</div>
              <div className="key-data-point">
                <span className="key-data-number">
                  {data.pm25Data[data.pm25Data.length - 1]?.pm25 || '-'}
                </span>
                <span className="key-data-label">Current PM2.5 Level (μg/m³)</span>
              </div>
              <div className="key-data-point">
                <span className="key-data-number">
                  {data.pm25Data.length > 0 
                    ? (data.pm25Data.reduce((acc, curr) => acc + curr.pm25, 0) / data.pm25Data.length).toFixed(1) 
                    : '-'
                  }
                </span>
                <span className="key-data-label">24h Average (μg/m³)</span>
              </div>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Dashboard;
